package mandatoryHomeWork.foundation;

import java.util.List;

import org.junit.Test;

import junit.framework.Assert;

public class Class_14092023_CamelCase {
	
	@Test
	public void test1() {
		Assert.assertEquals(5, cccase("saveChangesInTheEditor"));
	}
	
	@Test
	public void test2() {
		Assert.assertEquals(1, cccase("abc"));
	}
	
	@Test
	public void test3() {
		Assert.assertEquals(86, cccase(""));
	}

	public int cccase(String s) {
		// CamelCase
		
		/* Test Data 
		 * 1.s=parthivAjayVT o/p-4
		 * 2.s=aJAY o/p-4
		 * 3.s=aaaY o/p-2
		 * */
		
		/* Pseudo code 
		 * Initialize a counter variable
		 * iterate through the for loop
		 * if the character contains capital letter try to increment the count by 1
		 * return the count
		 * */
		
		int count=0;
		for (int i = 0; i < s.length(); i++) {
			for (char ch = 'A'; ch <= 'Z'; ch++) {
				if(s.charAt(i)==ch) {
					count++;
				}
			}
		}
		
		return count+1;
		
		
	}

}
